import React from "react";

const Footer = () => {
	return (
		<footer>
			<p className="footer-text">@Copyright 2024 - Sidea Andreea</p>
			<p className="text">
				DATA Source: The USGS Earthquake Hazards Program of the U.S. Geological
				Survey(USGS),part of the National Earthquake Hazards Reduction
				Program(NEHRP) led by the National Institute of Standards and
				Tehnology(NIST).
			</p>
		</footer>
	);
};
export default Footer;
